VALUES ('3428420000177', 'Vacherin glacé Vanille Framboise', 'Sorbet framboise (43,4 %) : purée de framboise 46 %, eau, sucre, dextrose de blé ou maïs, sirop de glucose déshydraté de blé ou maïs, stabilisants : hydroxypropylméthylcellulose, farine de graines de caroube et gomme guar, jus de citron. Crème glacée vanille (39,2 %) : LAIT entier, crème (LAIT), sucre, beurre concentré (LAIT), sirop de glucose déshydraté de blé ou maïs, LAIT écrémé en poudre, LACTOSE et protéines de LAIT, émulsifiant : mono - et diglycérides d\'acides gras, stabilisants : farine de graines de caroube et gomme guar, colorant : caroténoïdes, arôme naturel de vanille 0,2 %, gousses de vanille épuisées broyées 0,05 %. Crème fouetté sucrée (10,2 %) : crème (crème (LAIT), stabilisant : carraghénanes), sirop de sucre inverti, arôme vanille. Meringue (6,3 %) : sucre, blanc d\'_oeuf_. Éclats d\'amandes caramélisées (0,8 %) : AMANDES 96 % (FRUITS A COQUES), sucre, sirop de glucose, miel.', 'https://static.openfoodfacts.org/images/products/342/842/000/0177/front_fr.6.400.jpg', '9.3', '5.5', '27.8', '23.2', '0.3', '2.2', '0.381', '0.15', '', '0');

