INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3428420000375', 'Bûche poire chocolat', 'Sorbet poire (24%) : purée de poire sucrée 16%* (poire 90%, sucre, antioxydant : acide ascorbique), eau, sucre, sirop de glucose déshydraté de blé ou maïs, jus de citron, stabilisants : farine de graines de caroube, gomme guar, protéines de LAIT. (Ce sorbet contient 0,02% de protéines de LAIT.) Cubes de pomme caramélisés (23,1%) : cubes de pomme 22%*, sirop de glucose-fructose de blé, eau, sucre, caramel aromatique, épaississant : pectines, correcteur d\'acidité : acide citrique, antioxydant : acide ascorbique, chlorure de calcium, arôme naturel. Glace chocolat (20,7%) : eau, sucre, huile de coprah non hydrogénée, chocolat noir 1,6%* (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, extrait de vanille), cacao en poudre 0,9%*, LAIT écrémé en poudre, LACTOSE et protéines de LAIT, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube, gomme guar. Nougatine enrobée de beurre de cacao (18,5%) : sucre, sirop de glucose (sirop de glucose de blé, stabilisant : anhydride sulfureux (SULFITES)), AMANDES blanches effilées 2,9%* (FRUITS À COQUE), beurre de cacao. Décor (13,7%) : crème chantilly 10%* (crème stérilisée (crème (LAIT), stabilisant : carraghénanes), sucre, arôme naturel de vanille), pomme 2,3%*, jus de citron, étoile en chocolat noir (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de tournesol, arôme naturel de vanille), plaquette de chocolat (sucre, beurre de cacao, LAIT écrémé en poudre, pâte de cacao, matière grasse LAITIÈRE anhydre, émulsifiant : lécithine de SOJA, arôme naturel de vanille). Pourcentages exprimés sur le produit fini. Traces éventuelles de GLUTEN, OEUF, autres FRUITS À COQUE et SÉSAME. Les informations en majuscules sont destinées aux personnes intolérantes ou allergiques.', '', '9.1', '5.3', '38', '31.6', '1.8', '1.5', '0.03', '0.0118110236220472', '', '0');

