VALUES ('3428420001365', 'Le bonnet du père noël', 'Sorbet fraise (51 ,8%) : purée de fraise 25,8%, eau, sucre, sirop de glucose déshydraté de maïs, stabilisants : hydroxypfopylméthylcellulose, farines de graines de caroube, gomme guar, gélifiant : pectines. Crème glacée saveur vanille (27,1 %) : LAIT entier pasteurisé, sucre, crème pasteurisée (LAIT), beurre concentré (LAIT), sirop de glucose de maïs, jaune d\'OEUF pasteurisé, LAIT écrémé en poudre, émulsifiant : mono et diglycérides d\'acide gras d\'origine végétale, stabilisants : farine de graines de caroube et gomme guar, arôme naturel, gousses de vanille épuisées broyées. Enrobage à la fraise (10,5%) : eau, purée de fraise 3,5%, sucre, sirop de glucose de blé, fructose de blé, gélifiants : pectines, carraghénanes, acidifiant : acide citrique. Décor (10,6%) : pâte d\'amande 7,9% (sucre, AMANDE 1 ,7% (FRUITS À COQUE), sirop de glucose de blé, eau, stabilisant : sorbitol de blé et/ou de maïs, conservateur : sorbate de potassium), noix de coco râpée 1 ,3%, nappage à l\'abricot 0,65% (sirop de glucose de blé, sucre, eau, abricot 0,08%, fructose de blé, gélifiant : pectines, acidifiant : acide citrique), nappage (eau, sucre, sirop de glucose de blé, fructose de blé, gélifiants : pectines, carraghénanes, acidifiant : acide citrique). Pourcentages exprimés sur le produit fini.', 'https://static.openfoodfacts.org/images/products/342/842/000/1365/front_fr.4.400.jpg', '5.4', '3.5', '27.9', '21.3', '2', '1.6', '0', '0', '', '1');

