VALUES ('3428420002980', '4 bonshommes de Neige', 'Crème glacée saveur vanille (98%) : lait entier pasteurisé, sucre, crème pasteurisée, beurre concentré, sirop de glucose déshydraté de maïs ou de blé, jaune d\'oeuf sucré pasteurisé (jaune d\'oeuf, sucre 0,7%), lait écrémé en poudre, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube et gomme de guar, arôme vanille 0,2%. Pâte d\'amande colorée (1,3%) : pâte d\'amande (sucre, amandes 22%), sirop de glucose, eau, émulsifiant : sorbitol conservateur : sorbate de potassium), colorant : carmins. Préparation chocolat (0,7%) : sirop de glucose-fructose, eau, sucre, chocolat en poudre (poudre de cacao, sucre), humectant : glycérol, amidon modifié de tapioca, gélifiant : pectines, colorant : camarel au sulfite d\'ammonium, arôme naturel cacao, conservateur : sorbate de potassium, acidifiant : acide citrique, sel, affermissant : chlorure de calcium.', 'https://static.openfoodfacts.org/images/products/342/842/000/2980/front_fr.3.400.jpg', '23.1', '20.7', '13.7', '8.2', '0.1', '3.3', '0.1016', '0.04', '', '1');

