INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3428420003918', 'Buche glacée artisanale Mascarpone - Myrtille', 'Crème glacée au mascarpone (57,6%) : LAIT frais entier pasteurisé de la ferme 32%, sucre, CRÈME fraîche pasteurisée de Bretagne 6,9%, LACTOSE et protéines de IAT, mascarpone 3,4% (crème de LAIT, IAT entier, correcteur d\'acidité : acide citrique), dextrose, émulsifiant : mono. et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar. Crème glacée à la myrtille (27,7%) : LAIT frais entier pasteurisé de la ferme 7,8%, CRÈME fraîche pasteurisée de Bretagne 7,2%, purée de myrtille 4,9%, sucre, sirop de glucose déshydraté, LAIT écrémé en poudre, émulsifiant : mono- et diglycérides dacides gras, gélifiants : farine de graines de caroube - gomme guar, arôme naturel de myrtille avec autres arômes naturels. Enrobage violine (13,3%) : glaçage (sirop de glucose-fructose, eau, humectant : glycérol, sucre, épaississant : pectines, correcteurs d\'acidité : acide citrique - citrates de sodium), nappage (eau, sirop de glucose-fructose, sucre, gélifiants : pectines - carraghénanes, correcteurs d\'acidité : acide citrique - phosphates de potassium - citrates de calcium), sirop de sucre inverti cristallisé, eau, purée de framboise, purée de mydille, sucre, arôme naturel de mydille avec autres arômes naturels, colorants : carmins - bleu brillant FCF. Décors (1 ,3%) : décor au chocolat (sucre, beurre de cacao, poudre de IAT écrémé, matière grasse anhydre, émulsifiant : lécithine de SOJA, arôme naturel de vanille, : dioxyde de titane), plaquette décor au chocolat (pâte de cacao, sucre, beurre de cacao, arôme naturel de vanille, colorants : oxyde et hydroxyde de fer - carbonate de calcium). Traces éventuelles de GLUTEN, SOJA, OEUF et FRUITS À COQUE. Les informations en majuscules sont destinées aux personnes intolérantes ou allergiques. Conseil de conservation : Au (-180C). À consommer de préférence avant le : voir ci-dessous. NE JAMAIS RECONGELER UN PRODUIT DÉCONGELÉ. Conseil de dégustation : Sortir du congélateur quelques minutes avant de déguster.', 'https://static.openfoodfacts.org/images/products/342/842/000/3918/front_fr.11.400.jpg', '8.5', '5.6', '30', '26', '0.5', '3', '0.17', '0.0669291338582677', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3428420003925', 'Bûche glacée clémentine chocolat', 'Sorbet à la clémentine (45,8% ): jus de clémentine 19%, sucre, eau, dextrose, sirop de glucose déshydraté, jus de citron, stabilisants : hydroxypropylméthylcellulose-farine de graines de caroube-gomme guar-gomme anthane. Sorbet au chocolat (42.7% ): eau, chocolat noir à 64% de cacao 12 % (pâte de cacao du Pérou, Sucre, beurre de cacao, arôme naturel de vanille), sucre, dextrose, sirop de sucre inverti cristallisé, cacao en poudre, fibres d\'agrumes, épaississant: pectines. Enrobage à la clémentine et à la mandarine (11,2 %): glaçage (sirop de glucose-fructose, eau, humectant: glycérol, sucre, épaississant: pectines, correcteurs d\'acidité : acide citrique-citrates de sodium), nappage (eau, sirop de glucose-fructose, sucre, gélifiants:pectines-carraghénanes, correcteurs d\'acidité: acide citrique - phosphates de potassium - citrates de calcium), sirop de sucre inverti cristallisé, jus de clémentine 0,5%, eau, jus de mandarine concentré 0,3%, concentré végétal (concentré de potiron et de pomme) Plaquette au chocolat (0,3%) pate de cacao, sucre, beurre de cacao, arôme naturel de vanille, colorants: oxyde et hydroxyde de fer - carbonate de calcium.', 'https://static.openfoodfacts.org/images/products/342/842/000/3925/front_fr.4.400.jpg', '4.2', '2.5', '32', '30', '1.9', '1.2', '0.01', '0.00393700787401575', '', '0');

