INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3428420003956', 'Bûche Glacée Artisanale Poire, Caramel au Beurre Salé', 'Sorbet plein fruit à la poire Williams (47 %) : purée de poire Williams 28 %, sucre, eau, sirop de glucose déshydraté, jus de citron, stabilisants : farines de graines de caroube, gomme guar, protéines LAITIÈRES, antioxydant : acide ascorbique. Crème glacée au caramel au beurre, salé au sel de Guérande avec inclusions de caramel au beurre (44,8 %) : LAIT frais entier pasteurisé de la ferme 19%, caramel au beurre, salé au sel de Guérande 9,4 % (sirop de glucose de blé, sucre, BEURRE 1 %, eau, CRÈME, sel de Guérande 0,09 %), CRÈME fraîche pasteurisée de Bretagne 7,8 %, LACTOSE et protéines de LAIT, dextrose, jaunes d\'ŒUFS pasteurisés de Normandie, sucre, colorant : caramel ordinaire, émulsifiant : mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube, gomme guar, sel de Guérande. Préparation de caramel au beurre (5,7%) : sirop de glucose-fructose, LAIT concentré sucré, eau, BEURRE 0,2 %, caramel aromatique 0,05 % (sucre, eau), arôme naturel, gélifiant : pectines, émulsifiant : mono et diglycérides d\'acides gras. Flocage au chocolat noir (1,9 %) : chocolat noir à 70 % de cacao 0,7 % (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille), beurre de cacao, huile de tounesol. Décors (0,6 %) : plaquette au chocolat (pâte de cacao, sucre, beurre de cacao, arôme naturel de vanille, colorants : oxyde et hydroxyde de fer - carbonate de calcium), décor (sucre, graisse végétale (noix de coco, palmiste, palme, karité) en proportion variable, poudre de LAIT écrémé, poudre de cacao, beurre de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille, colorant : charbon végétal médicinal), nappage (sirop de glucose-fructose, sucre, eau, abricot, gélifiant : pectines, correcteurs d’acidité : acide citrique - phosphates de potassium).', 'https://static.openfoodfacts.org/images/products/342/842/000/3956/front_fr.11.400.jpg', '6.8', '4.7', '33', '28', '1.1', '1.7', '0.24', '0.094488188976378', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3428420003963', 'Traîneau 3 Chocolats', 'Glace chocolat (23,6 %) : eau, sucre, CRÈME pasteurisée (LAIT), cacao en poudre 1,3 %, dextrose de BLÉ, LAIT écrémé en poudre, LACTOSE et protéines de LAIT, sirop de sucre inverti, matière grasse végétale non hydrogénée de palme et de coco, BEURRE concentré (LAIT), sirop de glucose déshydraté de BLÉ ou maïs, chocolat 0,2 % (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, extrait de vanille), émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube, gomme guar, gomme de cellulose. CRÈME glacée chocolat-NOISETTE (23,6 %) : LAIT entier pasteurisé, sucre, chocolat au LAIT 2,06 % (sucre, beurre de cacao, LAIT entier en poudre, pâte de cacao, émulsifiant : lécithine de SOJA, extrait de vanille), jaune d’_œuf_, sirop de glucose déshydraté de BLÉ ou maïs, chocolat noir 0,86% (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, extrait de vanille), BEURRE concentré (LAIT), LAIT écrémé en poudre, LACTOSE et protéines de LAIT, pâte de NOISETTE 0,29 % (FRUITS A COQUE), cacao en poudre 0,17 %, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube, gomme guar. Nougatine (24,4 %) : sucre, sirop de glucose (contient anhydride sulfureux (SULFITES)), AMANDES blanches effilées (FRUITS A COQUE), beurre de cacao.CREME glacée chocolat blanc (14,2 %) : LAIT entier pasteurisé, chocolat blanc 2,69 % (sucre, beurre de cacao, LAIT entier en poudre, LAIT écrémé en poudre, émulsifiant : lécithine de SOJA, extrait de vanille), CRÈME pasteurisée (LAIT), sucre, LAIT écrémé en poudre, sirop de glucose déshydraté de BLÉ ou maïs, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube et gomme guar, arôme. Décor (14,2 %) : enrobage chocolat noir 6,7 % (BEURRE (LAIT), chocolat noir 4% (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, extrait de vanille), NOIX de coco râpée, CRÈME montée (CRÈME stérilisée (CRÈME (LAIT), stabilisant : carraghénanes), sirop de sucre inverti, arôme naturel), nappage (sirop de glucose-fructose, sucre, eau, abricot, gélifiant : pectines, acidifiants : acide citrique, phosphate de potassium), copeaux de chocolat (sucre, pâte de cacao, beurre de cacao, huile butyrique (LAIT), émulsifiant : lécithine de SOJA, arôme vanille), étoile en chocolat noir (pâte de cacao, sucre, beurre de cacao, arôme naturel vanille, colorants : oxydes et hydroxydes de fer, dioxyde de titane, carmins), plaquette de chocolat (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de tournesol, arôme naturel vanille, colorants : oxydes et hydroxydes de fer, dioxyde de titane, carmins). Pourcentages exprimés sur le produit fini.', '', '16.7', '7.6', '31.1', '28.4', '1.3', '4.3', '0.04', '0.015748031496063', '', '0');

