INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3428420019353', 'Buche gourmandine', 'Crème glacée chocolat noir (42,8%) : LAIT entier pasteurisé; CREME pasteurisée, chocolat noir (pâte de cacao, sucre, beurre de cacao, émulsifiant lécithine de SOJA, arôme naturel de vanille), sucre, dextrose, poudre de cacao, LAIT i écrémé en poudre, LACTOSE et protéines de LAIT, émulsifiant : mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar. Crème noisette avec éclats de noisettes caramélisés (33,2%) : LAIT entier pasteurisé, sucre, NOISETTES caramélisées 3,2% (NOISETTE, sucre, sirop de glucose de blé, miel) pâte de NOISETTE 2,9%, BEURRE concentré, LACTOSE et protéines de LAITI dextrose, émulsifiant : mono- et diglycérides diacides gras, gélifiants : farine de graines de caroube - gomme guar. Glaçage chocolat et éclats de praliné : chocolat noir à 70% de cacao 5,5% (pâte de cacao, sucre, beurre de cacao, émulsifiant : kécithine de SOJA, arôme naturel de vanille), beurre de cacao, éclats de NOISETTES e AMANDES caramélisées (sucre, AMANDES, NO!SETTES), huile de tournesoi. Meringue (6,6%) : sucre, blanc dlOEUF (blanc dlŒUF, stabiiisant : gomme xanthane). Sauce caramel au beurre et au sel : sirop de glucose, sucre, LAIT concentré sucré, eau, BEURRE, CREME fraîche, sel de Guérande, antioxydant : E306. Décors (3,4%) : nappage (sirop de glucose-fructose, sucre, eau, abricot, gé!ifiant : pectines, correcteurs d\'acidité : acide citrique-phosphates de potassium), AMANDES entières caramélisées (AMANDES, sucre, sirop de glucose de blé, miel)i NOISETTES caramélisées (NOISETTES, sucre, sirop de glucose de blé, miel), PISTACHES. plaquette décor (sucre, beurre de cacao, LAIT entier en poudre, LAIT écrémé en poudre, matière grasse LAITIERE anhydre, cacao maigre en poudre, émulsifiants lécithine de SOJA - E476, arôme naturel de vanille), chocolat noir à 70% de cacao (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille). Pourcentages exprimés sur le produit fini. Traces éventue!!es de GLUTEN, ARACHIDES, SESAME et autres FRUITS A COQUE. Les informations en majuscules sont destinées aux personnes intolérantes ou allergiques.', 'https://static.openfoodfacts.org/images/products/342/842/001/9353/front_fr.4.400.jpg', '18', '7.9', '29', '25', '2.3', '4.6', '0.15', '0.0590551181102362', '', '1');

