VALUES ('3428420051056', 'Craquotant', 'Mousse chocolat 57,96% : babeurre doux (Lait), huiles végétales (palme et palmiste), chocolat noir à 50% de cacao 8% (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille), chocolat noir à 70% de cacao 7% (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille), sucre, jaune d\'OEUF pasteurisé sucré (jaune d\'OEUF, sucre) dextrose, émulsifiants : E472b - E435 - E433 - mono - et diglycérides d\'acides gras, arôme, stabilisant : carraghénanes, colorant : E160a. Feuilletine 21,47% : pâte de praliné (sucre, NOISETTES (FRUITS À COQUE)), éclats de crêpe (farine de blé (GLUTEN), sucre, beurre concentré (LAIT), LAIT écrémé en poudre, malt d\'orge (GLUTEN), sel), chocolat au LAIT (sucre, beurre de cacao, poudre de LAIT entier, pâte de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille). Biscuit amande 18,68% : blanc D\'OEUF (blanc D\'OEUF, stabilisant : gomme xanthane), sucre, sucre glace (sucre, antiagglomérant : amidon de maïs), farine (farine de blé (GLUTEN), GLUTEN de blé) AMANDES en poudre 1% (FRUITS À COQUE), fécule de pomme de terre, stabilisant : gomme xanthane.  Flocage chocolat 1,2% : chocolat noir à 50% de cacao 0,4% (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille), beurre de cacao, huile de tournesol. Décor 0,69% : copeaux de chocolat noir (pâte de cacao, sucre, beurre de cacao, matière grasse laitière (LAIT), émulsifiant : lécithine de SOJA, arôme naturel de vanille).', 'https://static.openfoodfacts.org/images/products/342/842/005/1056/front_fr.8.400.jpg', '25.3', '15.2', '37.1', '31.4', '2.9', '4.9', '0.12', '0.047244094488189', '', '0');

