INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3428883635008', 'Herbesan Allaitement Bio - 20 Sachets - Herbesan', 'Fenouil* (graine) 53,4%, carvi* (graine) 33,3%, arôme naturel de citron 6%, verveine odorante* (feuille) 2,6%, tilleul* (fleurs) 2%, pensée sauvage* (parties aériennes) 2%, écorce de citron* 0,7%. *Ingrédients issus ded\'agriculture biologique. Conseils d\'utilisation : Afin de pouvoir savourer toute l\'intensité des arômes et les propriétés des plantes de votre infusion, versez de l\'eau frémissante sur un sachet à raison de 3 tasses par jour. Laissez infuser pendant 4 minutes avant de déguster. Précautions d\'emploi : Si vous êtes enceinte ou allaitante, il est conseillé de demander l\'avis de votre médecin pour encadrer au mieux \'utilisation de ce produit. Il est recommandé de respecter les doses conseillées, de veiller à avoir une alimentation variée et équilibrée et un mode de vie sain. Tenir hors de la portée des jeunes enfants.', '', '0.5', '0.5', '0.1', '0.1', '0.5', '0.5', '0.1', '0.0393700787401575', '', '1');

