INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3428883658007', 'Herbesan Digestion Facile - 20 Sachets - Herbesan', 'Menthe poivrée* (feuille) 53%, thym* (feuille) 15%, fenouil* (graine) 15%, mélisse* (feuille) 10%, arôme naturel de menthe 7%. *Ingrédients issus de l\'agriculture biologique. Conseils d\'utilisation : Afin de pouvoir savourer toute l\'intensité de la saveur et des propriétés des plantes de votre infusion, versez de l\'eau frémissante sur un sachet à raison de 2 à 3 tasses par jour. Laissez infuser pendant 4 minutes avant de déguster, de préférence le soir après le repas. Précautions d\'emploi : Ne convient pas en cas d\'hypersensibilité à l\'anéthol. Déconseillé aux femmes enceintes et allaitantes. Il est recommandé de respecter les doses conseillés, de veiller à avoir une alimentation variée et équilibrée et un mode de vie sain.', '', '0.6', '0.6', '0.4', '0.4', '0.5', '0.5', '0.1', '0.0393700787401575', '', '1');

