VALUES ('3428883658304', 'Confort Respiratoire Bio - 20 Sachets - Herbesan', 'Thym* (feuille) 54%, Eucalyptus* (feume) 20%, Mauve* (feuille) 13.3%, Ecorce de citron* 6.7%, Arôme naturel de citron avec autres arômes naturels 6%. *Ingrédients issus de l\'agriculture biologique. Conseils d\'utilisation : Afin de pouvoir savourer toute l\'intensité des arômes des plantes de votre infusion, versez de l\'eau frémissante sur un sachet à raison de 3 tasses par jour. Laissez infuser pendant 3 minutes avant de déguster. Précautions d\'emploi : Déconseillé aux enfants de moins de 12 ans, aux femmes enceintes et allaitantes, et aux personnes souffrant d\'allergie aux plantes de la famille des Lamiacées. Déconseillé en cas d\'inflammation gastro-intestinale ou biliaire, et en cas de u maladies hépatiques. Il est recommandé de respecter les doses conseillées, de veiller à avoir une alimentation variée et équilibrée et un mode de vie sain. Tenir hors de la ortée des jeunes enfants.', '', '0.5', '0.1', '0.5', '0.4', '0.5', '0.5', '0.03', '0.0118110236220472', '', '1');

