INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3431590000014', '500G Sel Fin', 'Situés au coeur d\'un parc naturel, les marais salants de m\'Atlantique produisent un sel légèrement gris, récolté manuellement selon la méthode traditionnelle. Il est le fruit d\'un savoir-faire ancestral que notre paludier partenaire perpétue d\'annee en années. Une fois récolté, le sel de l\'Atlantique est séché au soleil puis broyé. Non raffiné, non traité et sans additifs, il conserve ainsi ses sels et oliqo—elements.', '', '0', '0', '0', '0', '0', '0', '100', '39.3700787401575', '', '0');

